  false,\n\t\"url\": null,\n\t\"notes\": \"The Ocean Drilling Program (ODP) operated
  the drilling vessel JOIDES Resolution from 1984-2003 for over 100 cruises worldwide.
  n          The ODP was funded by the U.S. National Science Foundation and several
  countries through the Joint Oceanographic Institutions for Deep Earth Sampling (JOIDES).
  n          In 2005, the National Geophysical Data Center (NGDC) received a complete
  extract of prime scientific data from the ODP JANUS relational database for permanent
  archival at NGDC. n          Data include all of the digital sediment, and hard-rock
  data collected on all legs of the program stored in the JANUS database as of December
  2005. n          Data types include: 1) Bulk density estimation by gamma-ray attenuation
  densiometry (gra), 2) Carbon carbonate (carb), 3) Discrete p-wave velocity (pws1,
  pws2, pws3), n          4) Downhole temperature (temp), 5) Gas chromatography (gas),
  6) Inductively coupled plasma - atomic emission spectrometry (icp-aes), 7) Interstitial
  water (iw), n          8) Magnetic susceptibility (msl), 9) Moisture and density
  (mad), 10) Natural gamma radiation (ngr), 11) Palemagnetism (pmag), 12) P-wave velocity
  logger (pwl), n          13) Reflectance spectrophotometry and colorimetry (rsc),
  14) Rock evaluation (re), 15) Shear strength (avs, pen, tor), 16) Thermal conductivity
  (tcon), n          17) X-ray diffraction (xrd), and 18) X-ray fluorescence spectrometry
  (xrf). In 2007, NGDC received a complete copy of digital core photographs and closeup
  core photographs n          as high-resolution TIFF images from IODP for the ODP
  cores. Additional scanned microphotographs, photographs, and descriptive data were
  received in 2013. The photos are archived n          and available on request, but
  not offered online due to their volume. The data and images described above are
  distinct from the n          former data for ODP legs 101-129 published by NGDC
  on CDROM in both content and format.\",\n\t\"license_title\": null,\n\t\"extras\":
